import './ExpenseForm.css'
import { useState } from 'react'
 const ExpenseForm=()=>{
    const[title,setTitle]=useState('')
    const [amount,setAmount]=useState()
    const [date,setDate]=useState()
    const titleEventHandler=(event)=>{
        console.log("Title"+event.target.value)
    }

    const amountEventHandler=(event)=>{
        console.log("Amount"+event.target.value)
    }

    const dateEventHandler=(event)=>{
        console.log("Date"+event.target.value)
    }
    return(
        <form>
            <div className='new-expense__controls'>
            <div className='new-expense__control'>
                <label>Title</label>
                <input type='text' onChange={titleEventHandler} />
            </div>
            <div className='new-expense__control'>
                <label>Amount</label>
                <input type='number' min='0.1' step='0.1' onChange={amountEventHandler}/>
            </div>
            <div className='new-expense__control'>
                <label>Date</label>
                <input type='date' min='2019-01-01' max='2022-12-31' onChange={dateEventHandler} />
            </div>
            <div className='new-expense__actions'>
                <button type='submit'>Add Expense</button>
            </div>
        </div>
        </form>

    )
 }

 export default ExpenseForm;
